text:
@amktowncouncil has completed its Masterplan for the next five years. I was supposed to launch it this weekend along with an exhibition, but with the tighter measures to stem the spread COVID-19, this was called off.

The pandemic has preoccupied all of us, but we cannot drop everything and wait for it to pass. As we fight COVID-19, we must continue improving our home, and keep building Singapore. This e-book (https://bit.ly/amkmasterplan) outlines our plans for Ang Mo Kio. Residents can look forward to new aquatic playgrounds, a Sports Recreation Hub, and better amenities and facilities. A copy of the book will be delivered to all AMK households.

These new plans would not be possible without the collective efforts of grassroots leaders, town councillors and advisors. Not forgetting our residents, too, for their support over the years! We may be facing dark clouds now, but I am confident that our future is bright. â€“ LHL (Photo by me)

Took the Antigen Rapid Test (ART) for COVID-19 before attending Parliament this afternoon. It was quick and painless. 

During Phase 3, such testing will become a regular occurrence. This will allow infectious cases to be quickly identified (particularly asymptomatic cases), isolated and treated. Then the community at large can be kept safe, and life and work can continue more normally. â€“ LHL

(PMO Video by Alex Qiu)

